import React from "react";
import useQuotes from "../UseQuotes";

function Filter() {
  const { changeValue, filterAmount } = useQuotes();
  const changeV = (e) => {
    changeValue(e);
  };
  return (
    <div className="flex flex-col">
      <h1 className="font-bold text-5xl">Kanye oneliners</h1>
      <h3 className="font-bold text-3xl">Word count filter:</h3>
      <input type="number" value={filterAmount} onChange={changeV}></input>
    </div>
  );
}

export default Filter;
